var tipuesearch = {"pages": [{'title': 'About', 'text': 'Week1~5 \n Week6~9 \n Week10~14 \n Week15~18 \n 分組網站: https://s40723227.github.io/cd2020bg3/content/Assignment.html \n', 'tags': '', 'url': 'About.html'}, {'title': 'Weeks', 'text': '', 'tags': '', 'url': 'Weeks.html'}, {'title': 'Week1~Week5', 'text': 'Week1 \n 建立個人的倉儲 \n \n \n Week2 \n 更新Python3.7.3至3.8.2 \n 建立cd2020的資料夾，裡面建立data資料夾。 \n 下載Python3.8.2並安裝，安裝中記得要取消pip的安裝。 \n 下載 SciTE、MSYS2、PortableGit、 git-pip.py，除了git- pip.py丟到data，其他安裝。 \n 建立start.bat及stop.bat。 \n \n 分組分配作業 \n 作業為 \n 1.請描述如何針對該課程進行有效的隨機分組，或者隨機進行點名？ \n Week2抽查報告 \n \n Week3 \n 製作分組作業 \n Assignment 1 \n 亂數分組: \n from random import shuffle\nlist = ["40523253","40623114","40623115","40623117","40623121","40623251","40623252","40723201","40723203","40723204","40723205","40723206","40723207","40723209","40723210","40723212","40723213","40723216","40723218","40723219","40723221","40723222","40723223","40723225","40723226","40723227","40723228","40723229","40723230","40723232","40723233","40723234","40723236","40723237","40723238","40723239","40723240","40723241","40723242","40723243","40723244","40723245","40723246","40723247","40723249","40723250","40732319","40732331","40739214"]\nshuffle(list) #重排序\nx = 4 #分成n组\ny = int(len(list)/x)\nlist2 = []\nfor i in range(0, len(list), y):\n    list2.append(list[i:i+y])\nprint(list2)\n \n 隨機點名: \n import random\nlist = ["40523253","40623114","40623115","40623117","40623121","40623251","40623252","40723201","40723203","40723204","40723205","40723206","40723207","40723209","40723210","40723212","40723213","40723216","40723218","40723219","40723221","40723222","40723223","40723225","40723226","40723227","40723228","40723229","40723230","40723232","40723233","40723234","40723236","40723237","40723238","40723239","40723240","40723241","40723242","40723243","40723244","40723245","40723246","40723247","40723249","40723250","40732319","40732331","40739214"]\nn = 5 #t. \nprint( random.sample(list,n)) \n \xa0', 'tags': '', 'url': 'Week1~Week5.html'}, {'title': 'Week5~Week9', 'text': 'Week6 \n 翻譯MechanicalDesgnProcess部分 \n Assignment 2 \n \n Week7 \n 在v-rep建立四輪車，並用鍵盤操作： \n 先建立四輪車的本體，並拉到空中。 \n 再建造一個輪胎，設定 尺寸並調整其方向及位置。 \n 建立馬達，放到輪胎中心。 \n 複製並放到另外3個輪胎位置。 \n 將四輪車的前輪馬達命名為right_motor及left_motor。 \n 將寫好的程式碼放到四輪車內，就可使用了。 \n \n Week8 \n 第8周直播操作: \n https://drive.google.com/open?id=1kWc2PtlzJRqkmHFK_wy-4mOvc5b2fUya \n Week9 \n 期中報告影片', 'tags': '', 'url': 'Week5~Week9.html'}, {'title': 'Week10~Week14', 'text': 'Week10 \n 建立google api： \n clone cd2020pj1 倉儲 \n 進入 Google API， 建立專案。 \n 輸入專案cd2020pj1建立。 \n 啟用API和服務，選Google+ Domains API。 \n 再選擇內部， 輸入名稱，設定憑證。 \n 點選建立憑證及OAuth用戶端ID。 \n 建立網路應用程式。 \n 複製ID及密碼，命名為oauth_s學號.txt 存在tmp下。 \n 接著設定來源及URL， 接著存儲。 \n 用leo打開cd2020pj1.leo。 將路徑及名稱改為剛剛存的txt。 \n 完成後存儲，按ROC。 \n 在CMD輸入pip install authomatic。 \n 進入pj1，打開wsgi.py。 \n \n 第三次開會紀錄 \n Week11 \n Ubuntu設定 \n 下載 vitualbox、CoppeliaSim、ubuntu、 四輪車控制器。 \n 開啟vitualbox，匯入ubuntu。 \n 設定虛擬主機的網路埠號。 \n 啟動ubuntu， 輸入密碼kmol2020。 \n 開啟lxterminal， 輸入xterm&開啟。 \n 打開coppeliasim，輸入ls。 \n 依序打cd coppeliasim4_rev4\u3000ls\u3000cd CoppeliaSim_Edu_V4_0_0_Ubuntu18_04\u3000ls\u3000./coppeliaSim.sh \n 打開檔案sdc.ttt。 \n 開啟啟動器，並開啟四輪車控制器 \n 打開car_model.py，並執行。 \n 打開CoppeliaSim中的模擬。 \n \n Week12 \n Assignment 3 \n IPv4 Ubuntu對外連線設定 \n 新增一個新的NAT網路。 \n 編輯NAT網路。 \n 設定4個新的連接埠轉送埠號。 \n 設定主機網路為NAT Network。 \n 啟動ubuntu，開啟LXTermial，輸入sudo apt install net-tools，輸入密碼kmol2020。 \n cd tmp\u3000ls\u3000輸入ping 127.0.0.1測試。 \n cd cd2020pj1\u3000git pull。 \n 接著輸入sudo vi wsgi.py編輯內容。 \n 將近端的host改為10.0.2.4，接著按Esc並輸入:wq存儲。 \n 開啟leo，並開啟cd2020pj1.leo，點選Nav搜尋allowExt。 \n 點選fileuploadfrom，在第10行新增ttt存儲。 \n cd..，在tmp下輸入sudo vi oauth_scrum.txt。 \n 按i編輯隨便打，接著按Esc並輸入:wq存儲。 \n cd cd2020pj1，並輸入python3 wsgi.py啟動。 \n 網址為https:/127.0.0.1:18443/alogin。 \n 帳號及密碼都為admin，進入後點選fileuploadform，點選要上傳的ttt檔。 \n 點選download list檢查檔案是否上傳完成。 \n \n W12抽點網站: http://mde.tw/cdbw12-2/ \n W12抽點倉儲: https://github.com/mdecourse/cdbw12-2 \n 遇到問題 \n \n 解結方法: \n \n Week13 \n IPv6遠端控制 \n 修改網路介面卡IPV6 \n \n 2001:288:6004:17 \n 後面我的是 CDB:2 72為乙班 07為學號 \n 進入 Virtual Box \n 打ifconfig \n 查詢IPV6的號碼 \n 修改 Virtual Box的nat的網路設定 \n 接下來輸入cd tmp > cd\xa0cd2020pj1\xa0>cd\xa0docs\xa0>cd\xa0cmsimde >vi wsgi.py \n 修改host為IPV6\xa0 \n 存檔完輸入\xa0 python3 wsgi.py \n 在外部打開自己的網頁 \n https://[ 2001:288:6004:17:2020:2::7207]:17443 \n \n 完成 \n \n 之後用putty向 Virtual Box連線 \n 輸入IPV6 再到X1設定 \n 存檔並開啟，帳密都是kmol2020 \n 用Xlaunch快速下一步 \n 在putty打xterm&就可操作 \n 到 tmp/ cd2020pj1/docs/cmsimde \n 打python3 wsgi.py開啟 \n 就可以用了 \n \n \n W13抽點網站: http://mde.tw/cdbw13-3 \n W13抽點倉儲: https://github.com/mdecourse/cdbw13-3 \n week14 \n 下載FileZilla並安裝 \n 啟動Ubuntu主機，修改VMbox的IP \n 開啟FileZilla，選 檔案->站台管理員->新增站台 \n 改成 SFTP-SSH，主機輸入IP及連接埠輸入22 \n 登入型式改為詢問密碼，使用者命名為kmol2020 \n 點選連線，密碼：kmol2020 \n 即完成文件共享設定 \n \n W14抽點網站: http://mde.tw/cdbw14-1 \n W14抽點倉儲: https://github.com/mdecourse/cdbw14-1', 'tags': '', 'url': 'Week10~Week14.html'}, {'title': 'Week15~Week18', 'text': '', 'tags': '', 'url': 'Week15~Week18.html'}, {'title': 'Assignment', 'text': 'Assignment 1 \n Assignment 2 \n Assignment 3 \n \n', 'tags': '', 'url': 'Assignment.html'}]};